import java.util.LinkedList;
import java.util.Queue;
import java.util.Stack;

public class Day05 {

    public static void main(String[] args) {
        String input = "";
        String testInput = "dabAcCaCBAcCcaDA";

        char test= 'a';
        char test2= 'A';
        System.out.println((int) test+32);
        System.out.println((int) test2);
        System.out.println(test2 - test);

        Stack<Character> characterInputStack = new Stack<Character>();
        Stack<Character> characterOutputStack = new Stack<Character>();
        int counter = 0;

        for(Character character : testInput.toCharArray()){
            if(!characterInputStack.empty() && Math.abs(character - characterInputStack.peek()) == 32){

//                if(Character.toLowerCase(character) == Character.toLowerCase(characterInputStack.peek())) {
                    System.out.println("Current character: " + character);
                    System.out.println("Stack character: " + characterInputStack.peek());
                    System.out.println("-------------------------------------------");
                    counter++;
//                }
                characterInputStack.pop();
            } else {
                characterInputStack.push(character);
            }
        }
        System.out.println(counter);

//        System.out.println(testInput);
        while(!characterInputStack.isEmpty()){
            characterOutputStack.push(characterInputStack.pop());
        }

        while(!characterOutputStack.isEmpty()){
            System.out.print(characterOutputStack.pop());
        }

    }
}
